import mongoose, {ClientSession, ConnectOptions, Model, Document} from 'mongoose';

export const BITACORA = () => {

    const bitacora = {
        success: null,
        status: 0,
        process: '',
        messageUSR: '',
        messageDEV: '',
        countData: 0,
        countDataReq: 0,
        countDataRes: 0,
        countMsgUSR: 0,
        countMsgDEV: 0,
        data: [],
        session: ClientSession,
        loggedUser: ''
    }
    return bitacora;
};

export const DATA = () => {

    const data = {
        success: false,
        status: 0,
        process: '',
        principal: false,
        secuencia: 0,
        countDataReq: 0,
        countDataRes: 0,
        countFile: 0,
        messageUSR: '',
        messageDEV: '',
        method: '',
        api: '',
        dataReq: [],
        dataRes: [],
        file: []
    }

    return data;
};


/*     export const AddMSG = (bitacora, data) => {
	
    data.success    = data.success   || false;
