            Etiqueta: {type: String},
            Valor: {type: String},
            IdTipoSeccionOK: {type: String},
            Secuencia: {type: Number},
            detail_row: {
                _id: false,
                Activo: {type: String, default: 'S'},
                Borrado: {type: String, default: 'N'},
                detail_row_reg: [
                    {
                        _id: false,
                        FechaReg: {type: Date, default: Date.now()},
                        UsuarioReg: {type: String, default: 'SYSTEM'}
                    }
                ]
            }
        }
    ],
    detail_row: {
        _id: false,
        Activo: {type: String, default: 'S'},
        Borrado: {type: String, default: 'N'},
        detail_row_reg: [
            {
                _id: false,
